import { Typography } from "@material-ui/core";
import MyAccordian from "./MyAccordian";
function Accordian() {
  return (
    <>
      <Typography variant="h5">My Custom Accordian Style</Typography>
      <MyAccordian/>
    </>
  );
}

export default Accordian;
